import React, { Component } from 'react';
import styled from 'styled-components';
import { setIn } from '../../../node_modules/immutable';
const Wrapper = styled.div`
  display: flex;
  justify-content: center;
  align-items: center;
  width: 100%;
  height: 100%;
  background-color: #fff;
  padding: 0.1px;
  position: relative;

`;
const BgContainer = styled.div`
  width: 400px;
  height: 230px;
  position: absolute;
  top: 50%;
  margin-top: -100px;
  left: 50%;
  margin-left: -215px;
  box-sizing: border-box;
  p {
    width: 400px;
    height: 25px;
    line-height: 30px;
    text-align: center;
  }
`;
const Timer = styled.span`
  color: red;
`;
const Bg404 = styled.div`
  width: 400px;
  height: 200px;
  background-image: url(http://p6.qhimg.com/t01c0d7061aa4bb0be8.png);
  background-size: 100% 100%; 
`;
class NotFound extends Component {
  constructor(props) {
    super(props);
    this.state = {
      count: 5,
    }
  }
  handerSetTimer = () => {
    const timer = setInterval(() => {
      const tCount = this.state.count;
      if ( tCount > 1 ) {
        tCount -= 1;
      } else {
        this.props.history.push('/home');
        clearInterval(timer);
      }
    }, 1000);
  }
  render() {
    return (
      <Wrapper> 
        <BgContainer>
          <Bg404 />
          <p>
            <Timer></Timer>
            后返回首页
          </p>
        </BgContainer>       

      </Wrapper>
    )
  }
}

export default NotFound;
